import {ADD_QUESTION, TEST_TITLE_HANDLER, DEADLINE_HANDLER, COMPANY_HANDLER} from './actionTypes'

export function addQuestion(question) {
  return {
    type: ADD_QUESTION,
    question
  }
}

export function titleHandler(title) {
  return {
    type: TEST_TITLE_HANDLER,
    title
  }
}
export function deadlineHandler(date) {
  return {
    type: DEADLINE_HANDLER,
    date
  }
}
export function companyHandler(company) {
  return {
    type: COMPANY_HANDLER,
    company
  }
}

COMPANY_HANDLER
